import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import "../clientProfile.css";
import axios from "axios";
import Cookies from "js-cookie";
import logo from "../image/logo.svg";

function ClientProfilePage() {
  const location = useLocation();

  const [fullName, setFullName] = useState("");
  const [address1, setAddress1] = useState("");
  const [address2, setAddress2] = useState("");
  const [city, setCity] = useState("");
  const [state, setState] = useState("");
  const [zipcode, setZipcode] = useState("");

  const id = new URLSearchParams(location.search).get("id");
  const navigate = useNavigate();

  const handleClick = (toLink) => {
    navigate(`/${toLink}`);
  };

  const handleClickLogOut = (e) => {
    Cookies.remove("role");
    Cookies.remove("accessToken");
    e.preventDefault();
    navigate("/");
  };

  const handleClickLogo = (e) => {
    e.preventDefault();
    navigate("/ClientPage");
  };

  useEffect(() => {
    async function fetchData() {
      let accessToken = Cookies.get("accessToken");
      let webApiUrl = "http://localhost:5001/api/user/authGetUsers";
      const res = await axios.get(webApiUrl, {
        headers: { Authorization: `Bearer ${accessToken}` },
      });

      setFullName(res.data.Fullname);
      setAddress1(res.data.address1);
      setAddress2(res.data.address2);
      setCity(res.data.city);
      setState(res.data.state);
      setZipcode(res.data.zipcode);
    }
    fetchData();
  }, []);

  const handleSubmit = async (event) => {
    event.preventDefault();

    // Make an API call to update the user information on the backend
    try {
      let accessToken = Cookies.get("accessToken");
      let webApiUrl = "http://localhost:5001/api/user/UserInfoChange";
      const jsonBody = {
        Fullname: fullName,
        address1: address1,
        address2: address2,
        city: city,
        state: state,
        zipcode: zipcode,
      };
      const res = await axios.post(webApiUrl, jsonBody, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
          "content-type": "application/json",
        },
      });

